import React from "react";
import { createStackNavigator } from "@react-navigation/stack";
import styled from "styled-components";
import Home from "../screens/DashboardScreen";
import LakeList from "../screens/LakeListScreen";
import Contact from "../screens/ContactScreen";
import LakeSimpleScreen from "../screens/LakesSimpleScreen";
import Profile from "../screens/ProfileScreen";
import Social from "../screens/SocialScreen";
import LakeInfo from "../screens/LakeInfoScreen";
import { SearchBar } from "react-native-elements";
import { Dimensions } from "react-native";
import DashboardHeaderCard from "../components/dashboardHeaderCard";

function LogoTitle() {
  return (
    <SearchBar
      leftIconContainerStyle={{
        backgroundColor: "white"
      }}
      inputStyle={{ backgroundColor: "white" }}
      containerStyle={{
        backgroundColor: "white",
        width: Dimensions.get("window").width
      }}
      placeholder="Type Here..."
    />
  );
}

function LakeInfoHeader() {
  return (
    <Image
      style={{ width: Dimensions.get("window").width, height: 300 }}
      source={require("../assets/background11.jpg")}
    />
  );
}
const Stack = createStackNavigator();

const screenOptionStyle = {
  headerStyle: {
    backgroundColor: "#9AC4F8"
  },
  headerTintColor: "white",
  headerBackTitle: "Back"
};

const MainStackNavigator = () => {
  return (
    <Stack.Navigator screenOptions={screenOptionStyle}>
      <Stack.Screen
        options={{
          headerTransparent: true,
          title: "Adventures Await",
          headerTitleStyle: {
            fontWeight: "bold",
            fontSize: "25"
          }
        }}
        name="LakeSimpleScreen"
        component={LakeSimpleScreen}
      />
      <Stack.Screen name="Contact" component={Contact} />
    </Stack.Navigator>
  );
};

const LakesStackNavigator = () => {
  return (
    <Stack.Navigator screenOptions={screenOptionStyle}>
      <Stack.Screen
        options={{
          headerStyle: {
            height: 100
          },
          headerTitle: props => <LogoTitle {...props} />
        }}
        name="Lakes"
        component={LakeList}
      />
      <Stack.Screen
        options={{
          headerTransparent: true
        }}
        name="LakeInfo"
        component={LakeInfo}
      />
    </Stack.Navigator>
  );
};
const ProfileStackNavigator = () => {
  return (
    <Stack.Navigator screenOptions={screenOptionStyle}>
      <Stack.Screen name="Profile" component={Profile} />
      <Stack.Screen
        options={{
          headerTransparent: true
        }}
        name="LakeInfo"
        component={LakeInfo}
      />
    </Stack.Navigator>
  );
};

const SocialStackNavigator = () => {
  return (
    <Stack.Navigator screenOptions={screenOptionStyle}>
      <Stack.Screen name="Social" component={Social} />
    </Stack.Navigator>
  );
};
export {
  MainStackNavigator,
  LakesStackNavigator,
  SocialStackNavigator,
  ProfileStackNavigator
};
